const Trainers = (element) => {

    const trainers = [
        {
            id: 1,
            firstName: 'TAREK',
            lastName: 'Ashour',
            age: '30',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'

        },
        {
            id: 2,
            firstName: 'OMAR',
            lastName: 'Attia',
            age: '22',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'

        },
        {
            id: 3,
            firstName: 'ZEAD',
            lastName: 'Zooz',
            age: '22',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'

        },
        {
            id: 4,
            firstName: 'HAIDY',
            lastName: 'Alsayed',
            age: '22',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'

        },
        {
            id: 5,
            firstName: 'ZIYAD',
            lastName: 'Ashraf',
            age: '22',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'

        },
        {
            id: 6,
            firstName: 'KOBE',
            lastName: 'HOLL',
            age: '22',
            bio: '',
            photo: 'https://picsum.photos/id/1018/250/150/'
        }
    ]


    return (
        <div className="trainers">
            {
                trainers.map((trainer) => (

                    <div className="trainer" >
                        <img class="pps" src={trainer.photo} />
                        <div class={element.class}>{trainer.firstName}</div>
                    </div>

                )
                )
            }
        </div>
    )


}

export default Trainers
